import React from "react";

const About = () => {
  return (
    <section className="about">
      <div class="about-section">
        <h1>WELCOME</h1>
        <p>SpartantMeetup creates possibilities</p>
        <p>
          SpartantMeetup is a platform for finding and building local
          communities. People use Meetup to meet new people, learn new things,
          find support, get out of their comfort zones, and pursue their
          passions, together.{" "}
        </p>
      </div>
    </section>
  );
};

export default About;
